import java.util.Arrays;
import java.util.Scanner;

class  Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int[] arr = new int[n];
        for (int i = 0; i < n; i++) {
            arr[i] = sc.nextInt();
        }
        Arrays.sort(arr);
        int i = 1;
        int consecutive = 0;
        for (; i < n; i++) {
            if (arr[i] - arr[i - 1] == 1) {
                consecutive++;
            } else {
                if (consecutive >= 2) {
                    sb.append(arr[i - 1 - consecutive] + "-" + arr[i - 1] + " ");
                } else {
                    while (consecutive >= 0) {
                        sb.append(arr[i - consecutive - 1] + " ");
                        consecutive--;
                    }
                }
                consecutive = 0;
            }
        }
        if (consecutive >= 2) {
            sb.append(arr[i - 1 - consecutive] + "-" + arr[i - 1]);
        } else {
            while (consecutive >= 0) {
                sb.append(arr[i - consecutive - 1] + " ");
                consecutive--;
            }
            consecutive = 0;
        }
        System.out.println(sb);
    }

    static StringBuilder sb = new StringBuilder();
}
